import React from "react";
import DonorOrNGO from "./components/DonorOrNGO";
import { Switch, Route, Redirect } from "react-router-dom";
import SignUpAsDonor from "./components/Auth/SignUpAsDonor";
import SignUpAsNGO from "./components/Auth/SignUpAsNGO";
import LogInAsDonor from "./components/Auth/LogInAsDonor";
import LogInAsNGO from "./components/Auth/LogInAsNGO";
import AllCampaigns from "./components/createCampaign/AllCampaigns";
import NewCampaign from "./components/createCampaign/NewCampaign";
import Heading from "./components/Heading";
function App() {
  return (
    <div>
        <Switch>
          <Route path="/" exact>
            <Redirect to="/landingPage" />
          </Route>
          <Route path="/landingPage">
            <DonorOrNGO />
          </Route>
          <Route path="/suD">
            <SignUpAsDonor />
          </Route>
          <Route path="/suN">
            <SignUpAsNGO />
          </Route>
          <Route path="/liD">
            <LogInAsDonor />
          </Route>
          <Route path="/liN">
            <LogInAsNGO />
          </Route>
          <Route path="/cmcF">
            <NewCampaign />
          </Route>
          <Route path="/homePage">
            <Heading />
            <AllCampaigns />
          </Route>

        </Switch>
    </div>
  );
}
export default App;
